#funkce pro generování náhodného data 
def gen_date():
    start = datetime.date(1900, 1, 1)
    end = dnes
    
    timebetween = end - start;
    randomday = random.randrange(timebetween.days)
    returnTime = start + datetime.timedelta(days=randomday)
    return returnTime.strftime("%Y-%m-%d")

