def gen_random_sequence_string2():
    charArr = [0] * string2len
    
    for u in range(0,string2len):
        charArr[u] = random.choice(string.ascii_letters)
    string2 = ''.join(charArr)
    return string2

#vygenerovat string2 pomocí polsoupností až 400 po sobě jdoucích stejných písmen
def gen_long_sequence_string2():
    charArr = [""] * string2len
    length = 0
    j = 0
    
    while length != string2len:
        ranCharr = random.choice(string.ascii_letters)
        ranLength = random.randint(0,400)
        if (ranLength > (string2len - length)):
            ranLength = (string2len - length)
        length += ranLength
        charArr[j] = ranCharr * ranLength
        j += 1
        
    string2 = ''.join(charArr)        
    return string2
    
#rozhodnout se mezi dvemi moznostmi pro string2
def gen_string2():
    
    chance = random.randint(0,1)
    if (chance):
        return gen_random_sequence_string2()        
    else:
        return gen_long_sequence_string2()       
        
